import React from 'react';

function LoginPage() {
  return (
    <div className='login'>
      <section>
      <form action=''>
        <h1>Login</h1>
        <div class="input-box">
          <input type="text" placeholder='Username' required></input>
        </div>
        <div class="input-box">
          <input type="password" placeholder='Password' required></input>
        </div>
      </form>
      </section>
    </div>
  );
}

export default LoginPage;
